#include <fstream>
#include <vector>

#include <fftw3.h>
#include <netcdf.h>
#include <opencv2/core.hpp>
#include <opencv2/imgcodecs.hpp>
#include <openssl/bio.h>
#include <openssl/evp.h>

using namespace cv;
using std::move;
using std::pair;
using std::vector;

constexpr int row = 64;
constexpr int col = 256;
constexpr int pixels = row * col;

static const unsigned char gcm_key[] = {
        0xee, 0xbc, 0x1f, 0x57, 0x48, 0x7f, 0x51, 0x92, 0x1c, 0x04, 0x65, 0x66,
        0x5f, 0x8a, 0xe6, 0xd1, 0x65, 0x8b, 0xb2, 0x6d, 0xe6, 0xf8, 0xa0, 0x69,
        0xa3, 0x52, 0x02, 0x93, 0xa5, 0x72, 0x07, 0x8f
};

static const unsigned char gcm_iv[] = {
        0x99, 0xaa, 0x3e, 0x68, 0xed, 0x81, 0x73, 0xa0, 0xee, 0xd0, 0x66, 0x84
};

const char *filename = "data.nc";

static inline bool is_base64(unsigned char c) {
    return (isalnum(c) || (c == '+') || (c == '/'));
}

vector<unsigned char> base64_decode(const char *encoded_string) {
    static const std::string base64_chars =
            "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
            "abcdefghijklmnopqrstuvwxyz"
            "0123456789+/";
    int in_len = int(strlen(encoded_string));
    int i = 0;
    int j = 0;
    int in_ = 0;
    unsigned char char_array_4[4], char_array_3[3];
    vector<unsigned char> ret;

    while (in_len-- && (encoded_string[in_] != '=') && is_base64(encoded_string[in_])) {
        char_array_4[i++] = encoded_string[in_];
        in_++;
        if (i == 4) {
            for (i = 0; i < 4; i++)
                char_array_4[i] = base64_chars.find(char_array_4[i]);

            char_array_3[0] = (char_array_4[0] << 2) + ((char_array_4[1] & 0x30) >> 4);
            char_array_3[1] = ((char_array_4[1] & 0xf) << 4) + ((char_array_4[2] & 0x3c) >> 2);
            char_array_3[2] = ((char_array_4[2] & 0x3) << 6) + char_array_4[3];

            for (i = 0; (i < 3); i++)
                ret.push_back(char_array_3[i]);
            i = 0;
        }
    }

    if (i) {
        for (j = i; j < 4; j++)
            char_array_4[j] = 0;

        for (j = 0; j < 4; j++)
            char_array_4[j] = base64_chars.find(char_array_4[j]);

        char_array_3[0] = (char_array_4[0] << 2) + ((char_array_4[1] & 0x30) >> 4);
        char_array_3[1] = ((char_array_4[1] & 0xf) << 4) + ((char_array_4[2] & 0x3c) >> 2);
        char_array_3[2] = ((char_array_4[2] & 0x3) << 6) + char_array_4[3];

        for (j = 0; (j < i - 1); j++) ret.push_back(char_array_3[j]);
    }

    return ret;
}

void init() {
    const char* base64 = "";
    const auto data = base64_decode(base64);
    std::ofstream ofs(filename, std::ios::binary);
    ofs.write(reinterpret_cast<const char *>(data.data()), data.size());
    ofs.close();
}

vector<unsigned char> read_from_netcdf() {
    int ncid, varid, x_dimid;
    size_t size;
    vector<unsigned char> data;
    nc_open(filename, NC_CLOBBER, &ncid);
    nc_inq_varid(ncid, "data", &varid);
    nc_inq_dimid(ncid, "x", &x_dimid);
    nc_inq_dimlen(ncid, x_dimid, &size);
    data.resize(size);
    nc_get_var_ubyte(ncid, varid, data.data());
    nc_close(ncid);
    return data;
}

vector<pair<float, float>> aes_gcm_decrypt(vector<unsigned char> &&data) {
    EVP_CIPHER_CTX *ctx;
    int outlen;
    vector<pair<float, float>> outbuf;
    outbuf.resize(data.size() / sizeof(pair<float, float>));
    ctx = EVP_CIPHER_CTX_new();
    EVP_DecryptInit_ex(ctx, EVP_aes_256_gcm(), nullptr, gcm_key, gcm_iv);
    EVP_DecryptUpdate(ctx, reinterpret_cast<unsigned char *>(outbuf.data()), &outlen, data.data(), int(data.size()));
    EVP_CIPHER_CTX_free(ctx);
    return outbuf;
}

vector<float> ifft(vector<pair<float, float>> &&array) {
    fftw_complex in[pixels], out[pixels];
    fftw_plan p;
    for (int i = 0; i < pixels; ++i) {
        in[i][0] = array[i].first;
        in[i][1] = array[i].second;
    }
    p = fftw_plan_dft_1d(pixels, in, out, FFTW_BACKWARD, FFTW_ESTIMATE);
    fftw_execute(p);
    fftw_destroy_plan(p);
    auto result = vector<float>();
    result.reserve(pixels);
    for (auto &i: out) {
        result.push_back(float(i[0]));
    }
    return result;
}

void write_to_image(vector<float> &&array) {
    auto image = Mat(row, col, CV_32FC1, array.data());
    imwrite("output.png", image);
}

int main(int argc, char **argv) {
    init();
    auto data = read_from_netcdf();
    auto decrypted = aes_gcm_decrypt(move(data));
    auto ifft_array = ifft(move(decrypted));
    write_to_image(move(ifft_array));
    return 0;
}